import React from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Navbar from "./navbar";
import Sigin from "./paths/signin";

function Router() {
    return <BrowserRouter>
            <Switch>
                <Route exact path="/">
                    <div>Home</div>
                </Route>
                <Route  path="/signin">
                <Sigin />
                </Route>
                <Route  path="/singup">
                </Route>
            </Switch>
    </BrowserRouter>
}

export default Router;
